import React from "react";
import {
  BrowserRouter as Router,
  Switch,
  Route,
} from "react-router-dom";
import HomePage from "./HomePage/Organisms";
import Follow from "./Follow/Follow";
const RoutePage = () =>{
    return(
        <>
        <Router>
            <Switch>
                <Route path="/" exact>
                    <HomePage/>
                </Route>
                <Route path="/follow" exact>
                    <Follow/>
                </Route>
            </Switch>
        </Router>
        </>
    )
}
export default RoutePage;
